UPDATE `branches` 
join `employee_branches` on `branches`.branch_id = `employee_branches`.branch_id
set `branches`.`manager_id` = `employee_branches`.`employee_branches_id`
where `employee_branches`.`department_id` = 1;




START TRANSACTION;



UPDATE orders 
JOIN reservation_slips r on orders.reservation_slip_id = r.reservation_slip_id 
SET orders.branch_id = r.branch_id;

UPDATE order_details
JOIN orders o on order_details.order_id = o.order_id
SET order_details.branch_id = o.branch_id;

COMMIT;





